import { Box } from "@mui/material";
import "./App.css";
import Feed from "./components/Feed";
import Rightbar from "./components/Rightbar";
import Sidebar from "./components/Sidebar";

function App() {
  return (
    <div>
      {/* <p>app works!</p> */}
      <Box>
      {/* navbar */}
        <Sidebar />
        <Feed />
        <Rightbar />
      </Box>
    </div>
  );
}

export default App;
